package main

import (
	"fmt"
	"time"
)

var arrObj = []byte{
	'a',
	'e',
	'i',
	'o',
	'u',
}

var obj = make(map[byte]bool)

func findTheLongestSubstring(s string) int {
	obj['a'] = true
	obj['e'] = true
	obj['i'] = true
	obj['o'] = true
	obj['u'] = true
	// 整理s，把非元音符号转化为数字长度，并转成数组
	arr := []byte{}
	arrValue := []int{}
	size := 0
	for _, value := range s {
		if _, ok := obj[byte(value)]; ok == true {
			if size > 0 {
				arr = append(arr, 'x')
				arrValue = append(arrValue, size)
			}
			size = 0
			arr = append(arr, byte(value))
			arrValue = append(arrValue, 1)
		} else {
			size++
		}
	}
	// fmt.Println(arrValue)

	for _, c := range arrObj {
		size, left, right := vowelSizeOfStr(c, arr, 0, len(arr))
		fmt.Println(size, left, right)
	}
	result := 0
	splitStr(arr, arrValue, 0, len(arr), &result)
	return result
}

func splitStr(s []byte, arr []int, start int, end int, result *int) {
	// fmt.Println(start, end, *result)
	mark := true
	for _, c := range arrObj {
		size, left, right := vowelSizeOfStr(c, s, start, end)
		// fmt.Println(size, left, right)
		if size%2 == 1 {
			// 这次的s数据不能进行计算长度，里面有奇数的元音字符
			mark = false
			// 递归分别以两边的元音字符为中心分割的两个字符为参数,如果size=1  则只操作一次
			if size == 1 {
				splitStr(s, arr, start, left, result)
				splitStr(s, arr, left, end, result)
			} else {
				splitStr(s, arr, start, left, result)
				splitStr(s, arr, left, end, result)
				splitStr(s, arr, start, right, result)
				splitStr(s, arr, right, end, result)
			}
		}
	}
	if mark == true {
		count := 0
		for i := start; i < end; i++ {
			count += arr[i]
		}
		if *result < count {
			*result = count
		}
	}
}

func vowelSizeOfStr(c byte, s []byte, start int, end int) (int, int, int) {
	size := 0
	left := len(s)
	right := 0
	for index := start; index < end; index++ {
		if s[index] == c {
			if index < left {
				left = index
			}
			if index > right {
				right = index
			}
			size++
		}
	}
	return size, left, right
}

func main() {
	start := time.Now().UnixNano()
	s := ""
	fmt.Println(findTheLongestSubstring(s))
	fmt.Println((time.Now().UnixNano() - start) / 1000000)
}
